import React from "react";
import styled from "styled-components";

const FoodList = ({ currentPlace, list }) => {
  console.log(currentPlace);
  console.log(list);
  return (
    <Container>
      {list.length !== 0 && (
        <ul>
          {list.map((v) => {
            return <li>{v.place_name}</li>;
          })}
        </ul>
      )}
    </Container>
  );
};

export default FoodList;

const Container = styled.div`
  width: 100%;
`;
